import React from 'react';
import { Route } from 'react-router-dom';
import { render } from 'react-dom';

class protectedRoutes {
  render({ component: Component, ...rest }) {
    return (
      <Route
        {...rest}
        render={(props) => {
          return <Component {...props} />;
        }}
      />
    );
  }
}

export default protectedRoutes;
